import React from 'react';
import './NavBar.css';

const NavBar = () => {
  return (
    <div>
      <nav>
        <a href="#">Home</a>
        <a href="#">About</a>
        <a href="#">Contacts</a>
        <a href="#">Login</a>
      </nav>
      <div>
        <h1>LEARNIFY</h1>
        <h3>Empowering learning for everyone</h3>
      </div>
    </div>
  );
};

export default NavBar;
